import React from 'react'
import { Decoration,Loginfo,Container , Barrasuperior ,Photocv, Photocont, Blackc,Bluec,Redc, Infocont, Linea,Nombre
         ,Apellidos,Pinfo,Correo,Ubicacion,Telefono, Datosgen, Contacto,Textos} from './LoginElements'


const Barrasup = () => {

  return (
    <Container>
        <Decoration>
        <Particles
    params={{
	    "particles": {
	        "number": {
	            "value": 160,
	            "density": {
	                "enable": false
	            }
	        },
	        "size": {
	            "value": 10,
	            "random": true
	        },
	        "move": {
	            "direction": "bottom",
	            "out_mode": "out"
	        },
	        "line_linked": {
	            "enable": false
	        }
	    },
	    "interactivity": {
	        "events": {
	            "onclick": {
	                "enable": true,
	                "mode": "remove"
	            }
	        },
	        "modes": {
	            "remove": {
	                "particles_nb": 10
	            }
	        }
	    }
	}} />
        </Decoration>
        <Loginfo>
            
        </Loginfo>
    </Container>
  
  )
}

export default Barrasup
